export default async function deleteFavUser(UserID,MusicID){
  var Url = 'http://136.244.119.40:8000/api/fav/del/'+ UserID + '/' + MusicID;
  return await fetch(Url, {
    method : 'GET'
  })
  .then(response => response.json())
  .catch(err => console.log(err))
}
